Ben Stryker is a former soldier who rolls in on his motorcycle into the dusty old Western town of Agua Dulce. He is a man of few words, and lets his short spiky blonde hair do the talking. Or, failing that, he is pretty handy in a fight. He goes to see his wheelchair-bound buddy Tick, and his son Danny, and reconnects with his old girlfriend Katie. But breaking up all the fond camaraderie is the notorious Savages biker gang. They come to the quiet town and start raising all sorts of hell.


